import React, { Component }from 'react';
import fetch from 'node-fetch'
// import logo from './logo.svg';
// import './App.css';

class App extends Component{
  constructor(props) {
    super(props)
    this.state = {
      name: []
    }
  }

  componentWillMount () {
    const URL = 'http://localhost:8080/getBirthStoneList'
    fetch(URL, {mode: 'cors'})
    .then(res => res.json())
    .then(data => {
      // console.log(data)
      this.setState({
        name: data
      })

    });
  }


  renderStone() {
    console.log(this.state)
    const namea = this.state.name
    return {namea}
  }

  render() {
    return (
      <div>{this.renderStone()}</div>
    );
  }
}

export default App;
